CREATE TABLE USCDI_filter(
    "YearStart" NUMBER(4,0),
    "YearEnd" NUMBER(4,0),
    "LocationDesc" VARCHAR(50),
    "Topic" VARCHAR(30),
    "Question" VARCHAR(100),
    "DataValueUnit" VARCHAR(20),
